  return (
    <div>
      <Card>
        <CardContent>
          <TextField
            multiline
            rows={2}
            rowsMax={6}
            fullWidth
            helperText={"What's on your mind?"}
          />
        </CardContent>
      </Card>
    </div>
  )
}

export default CreatePost
